inline constexpr size_t TRAFFIC_NUM_TREES = 100;
inline constexpr size_t TRAFFIC_NUM_FEATURES = 10;

/// @brief Predice si el trfico es interno o de internet
/// @param features Array de features normalizadas [0.0-1.0]:
///   [0] packet_rate
///   [1] connection_rate
///   [2] tcp_udp_ratio
///   [3] avg_packet_size
///   [4] port_entropy
///   [5] flow_duration_std
///   [6] src_ip_entropy
///   [7] dst_ip_concentration
///   [8] protocol_variety
///   [9] temporal_consistency
/// @return Probability of INTERNAL traffic (0.0 to 1.0)
inline float traffic_predict(const std::array<float, TRAFFIC_NUM_FEATURES>& features) {
    float internet_prob = 0.0f;
    float internal_prob = 0.0f;
    
    for (size_t tree_idx = 0; tree_idx < TRAFFIC_NUM_TREES; ++tree_idx) {
        const TrafficNode* tree = traffic_trees[tree_idx];
        size_t node_idx = 0;
        
        while (true) {
            const auto& node = tree[node_idx];
            
            if (node.feature_idx == -2) { // Leaf node
                internet_prob += node.value[0];
                internal_prob += node.value[1];
                break;
            }
            
            if (features[node.feature_idx] <= node.threshold) {
                node_idx = node.left_child;
            } else {
                node_idx = node.right_child;
            }
        }
    }
    
    // Return probability of INTERNAL traffic (class 1)
    return internal_prob / TRAFFIC_NUM_TREES;
}

